SELECT DISTINCT ca.ca_county FROM customer_address ca JOIN store_sales ss1 ON ca.ca_address_sk = ss1.ss_addr_sk JOIN date_dim d1 ON ss1.ss_sold_date_sk = d1.d_date_sk JOIN store_sales ss2 ON ca.ca_address_sk = ss2.ss_addr_sk JOIN date_dim d2 ON ss2.ss_sold_date_sk = d2.d_date_sk JOIN store_sales ss3 ON ca.ca_address_sk = ss3.ss_addr_sk JOIN date_dim d3 ON ss3.ss_sold_date_sk = d3.d_date_sk JOIN web_sales ws1 ON ca.ca_address_sk = ws1.ws_bill_addr_sk JOIN date_dim d4 ON ws1.ws_sold_date_sk = d4.d_date_sk JOIN web_sales ws2 ON ca.ca_address_sk = ws2.ws_bill_addr_sk JOIN date_dim d5 ON ws2.ws_sold_date_sk = d5.d_date_sk JOIN web_sales ws3 ON ca.ca_address_sk = ws3.ws_bill_addr_sk JOIN date_dim d6 ON ws3.ws_sold_date_sk = d6.d_date_sk WHERE d1.d_year = 2000 AND d1.d_qoy = 1 AND d2.d_year = 2000 AND d2.d_qoy = 2 AND d3.d_year = 2000 AND d3.d_qoy = 3 AND d4.d_year = 2000 AND d4.d_qoy = 1 AND d5.d_year = 2000 AND d5.d_qoy = 2 AND d6.d_year = 2000 AND d6.d_qoy = 3 GROUP BY ca.ca_county HAVING SUM(ws1.ws_net_paid) / SUM(ss1.ss_net_paid) > 1 AND SUM(ws2.ws_net_paid) / SUM(ss2.ss_net_paid) > 1 AND SUM(ws3.ws_net_paid) / SUM(ss3.ss_net_paid) > 1;
